import { Link } from "react-router-dom";

function Products() {
  return (
    <>
      <h1>Products</h1>
      <ul>
        <li>
          <Link to="/products/product-1">1</Link>
        </li>
        <li>
          <Link to="/products/product-2">2</Link>
        </li>
        <li>
          <Link to="/products/product-3">3</Link>
        </li>
      </ul>
    </>
  );
}

export default Products;
